void swap(int *x, int *y)
{
	int temp = *y;
	*y = *x;
	*x = temp;
}


// in iteration i, find index min of smallest remaining entry, swap a[i] and a[min]
// time: 713	1/2N^2 compares and N changes
void selection_sort(int* a, int l)
{
	for (int i = 0; i < l; i++)
	{
		int min = i;
		for (int j = i + 1; j < l; j++)
		{
			min = a[j] < a[min] ? j : min;
		}
		swap(&a[i], &a[min]);
	}
}


// in iteration i, swap a[i] with each lager entry to its left
// time: 2153	1/4N^2 compares and 1/4N^2 changes
void insertion_sort(int* a, int l)
{
	for (int i = 0; i < l; i++)
	{
		for (int j = i; j > 0 && a[j] < a[j - 1]; j--)
			swap(&a[j], &a[j - 1]);
	}
}


// shellsort: h-sort array for decreasing sequence of values of h, h use 3x + 1
// time: 12		
void shellsort(int* a, int l)
{
	int h = 1;
	while (l > 3 * h)
		h = 3 * h + 1;		// 3x + 1 increase sequence(find the biggest h)

	while (h >= 1)
	{
		for (int i = h; i < l; i++)
		{
			for (int j = i; (j > h) && (a[j] < a[j - h]); j -= h)
				swap(&a[j], &a[j - h]);
		}

		h = h / 3;
	}
}
